import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";
import { parseDiff, Diff, Hunk } from "react-diff-view";
import "react-diff-view/style/index.css";

export default function PRDetails() {
  const { owner, repo, number } = useParams();
  const [prDetails, setPrDetails] = useState(null);
  const [fileDiffs, setFileDiffs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchData = async () => {
      const token = localStorage.getItem("authToken");
      if (!token) {
        setError("No authentication token found.");
        setLoading(false);
        return;
      }

      try {
        // 1. Fetch PR metadata
        const res = await fetch(
          `http://localhost:5001/github/repos/${owner}/${repo}/pulls/${number}/details`,
          { headers: { Authorization: `Bearer ${token}` } }
        );
        if (!res.ok) throw new Error(`Failed to fetch PR details: ${res.status}`);
        const data = await res.json();
        setPrDetails(data.details || data);

        // 2. Fetch PR file changes
        const filesRes = await fetch(
          `http://localhost:5001/github/repos/${owner}/${repo}/pulls/${number}/files`,
          { headers: { Authorization: `Bearer ${token}` } }
        );
        if (!filesRes.ok) throw new Error(`Failed to fetch PR files: ${filesRes.status}`);
        const filesData = await filesRes.json();

        // 3. Convert GitHub patches to diff format
        const patches = filesData
          .filter(f => f.patch)
          .map(f => `diff --git a/${f.filename} b/${f.filename}\n${f.patch}`)
          .join("\n");

        const parsed = parseDiff(patches);
        setFileDiffs(parsed);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [owner, repo, number]);

  if (loading) return <p className="text-center mt-5">Loading PR details...</p>;
  if (error) return <p className="text-center text-danger mt-5">{error}</p>;
  if (!prDetails) return <p className="text-center mt-5">No details found for this PR.</p>;

  return (
    <div className="container py-4">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>
          PR #{prDetails.number}: <span className="text-primary">{prDetails.title}</span>
        </h2>
        <Link to={`/repos/${owner}/${repo}/prs`} className="btn btn-secondary">
          â¬… Back to PR List
        </Link>
      </div>

      <p>
        <strong>State:</strong>{" "}
        <span className={`badge ${prDetails.state === "open" ? "bg-success" : "bg-secondary"}`}>
          {prDetails.state?.toUpperCase() || "UNKNOWN"}
        </span>
      </p>
      <p><strong>Author:</strong> {prDetails.user?.login || "N/A"}</p>
      <p><strong>Created At:</strong> {prDetails.created_at ? new Date(prDetails.created_at).toLocaleString() : "N/A"}</p>
      <p><strong>Updated At:</strong> {prDetails.updated_at ? new Date(prDetails.updated_at).toLocaleString() : "N/A"}</p>
      <hr />
      <h4>Description</h4>
      <p>{prDetails.body || "No description provided."}</p>
      <hr />
      <h3>Files Changed</h3>
      {fileDiffs.length === 0 && <p>No file changes found.</p>}
      {fileDiffs.map(file => (
        <div key={file.newPath} style={{ marginBottom: "2rem" }}>
          <h5>{file.newPath}</h5>
          <Diff viewType="split" diffType={file.type} hunks={file.hunks}>
            {hunks => hunks.map(hunk => <Hunk key={hunk.content} hunk={hunk} />)}
          </Diff>
        </div>
      ))}
    </div>
  );
}
